import logo from './logo.svg';
import './App.css';

import React from 'react';
import { BrowserRouter as Router, Route } from 'react-router-dom';
import Login from './Login';

const App = () => {
  return (
    <Router>
      <Route path="/" exact component={Login} />
    </Router>
  );
}

export default App;
